	self:SubscribeToModel( DataSources.alwaysLoaded.player.currentWeapon.shotCounter:GetModel( f1_local1 ), function ()
		ACTIONS.AnimateSequence( menu, "Onfire", menu )
	end )
	f0_local0( self, f1_local1, controller )
	return self
end

